name <String> Name of the function on the window object. callback <BindingCallback> Callback function that will be called in the Playwright's context. options <BrowserContext.ExposeBindingOptions> withHandle <boolean> Whether to pass the argument as a handle, instead of passing by value. When passing a handle, only one argument is supported. When passing by value, multiple arguments are supported. The method adds a function called name on the window object of every frame in every page in the context. When called, the function executes callback and returns a Promise which resolves to the return value of callback. If the callback returns a Promise, it will be awaited. The first argument of the callback function contains information about the caller: { browserContext: BrowserContext, page: Page, frame: Frame }. See Page.exposeBinding(name, callback[, options]) for page-only version. An example of exposing page URL to all frames in all pages in the context: import com.microsoft.playwright.*; public class Example { public static void main(String[] args) { try (Playwright playwright = Playwright.create()) { BrowserType webkit = playwright.webkit() Browser browser = webkit.launch(new BrowserType.LaunchOptions().withHeadless(false)); BrowserContext context = browser.newContext(); context.exposeBinding("pageURL", (source, args) -> source.page().url()); Page page = context.newPage(); page.setContent("<script>
" + " async function onClick() {
" + " document.querySelector('div').textContent = await window.pageURL();
" + " }
" + "</script>
" + "<button onclick="onClick()">Click me</button>
" + "<div></div>"); page.click("button"); } } } An example of passing an element handle: context.exposeBinding("clicked", (source, args) -> { ElementHandle element = (ElementHandle) args[0]; System.out.println(element.textContent()); return null; }, new BrowserContext.ExposeBindingOptions().withHandle(true)); page.setContent("" + "<script>
" + " document.addEventListener('click', event => window.clicked(event.target));
" + "</script>
" + "<div>Click me</div>
" + "<div>Or click me</div>
");

name <String> Name of the function on the window object. callback <FunctionCallback> Callback function that will be called in the Playwright's context. The method adds a function called name on the window object of every frame in every page in the context. When called, the function executes callback and returns a Promise which resolves to the return value of callback. If the callback returns a Promise, it will be awaited. See Page.exposeFunction(name, callback) for page-only version. An example of adding an md5 function to all pages in the context: import com.microsoft.playwright.*; import java.nio.charset.StandardCharsets; import java.security.MessageDigest; import java.security.NoSuchAlgorithmException; import java.util.Base64; public class Example { public static void main(String[] args) { try (Playwright playwright = Playwright.create()) { BrowserType webkit = playwright.webkit() Browser browser = webkit.launch(new BrowserType.LaunchOptions().withHeadless(false)); context.exposeFunction("sha1", args -> { String text = (String) args[0]; MessageDigest crypto; try { crypto = MessageDigest.getInstance("SHA-1"); } catch (NoSuchAlgorithmException e) { return null; } byte[] token = crypto.digest(text.getBytes(StandardCharsets.UTF_8)); return Base64.getEncoder().encodeToString(token); }); Page page = context.newPage(); page.setContent("<script>
" + " async function onClick() {
" + " document.querySelector('div').textContent = await window.sha1('PLAYWRIGHT');
" + " }
" + "</script>
" + "<button onclick="onClick()">Click me</button>
" + "<div></div>
"); page.click("button"); } } }

