name <String> Name that is used in selectors as a prefix, e.g. {name: 'foo'} enables foo=myselectorbody selectors. May only contain [a-zA-Z0-9_] characters. script <String|Path> Script that evaluates to a selector engine instance. options <Selectors.RegisterOptions> withContentScript <boolean> Whether to run this selector engine in isolated JavaScript environment. This environment has access to the same DOM, but not any JavaScript objects from the frame's scripts. Defaults to false. Note that running as a content script is not guaranteed when this engine is used together with other registered engines. An example of registering selector engine that queries elements based on a tag name: // Script that evaluates to a selector engine instance. String createTagNameEngine = "{
" + " // Returns the first element matching given selector in the root's subtree.
" + " query(root, selector) {
" + " return root.querySelector(selector);
" + " },
" + " // Returns all elements matching given selector in the root's subtree.
" + " queryAll(root, selector) {
" + " return Array.from(root.querySelectorAll(selector));
" + " }
" + "}"; // Register the engine. Selectors will be prefixed with "tag=". playwright.selectors().register("tag", createTagNameEngine); Browser browser = playwright.firefox().launch(); Page page = browser.newPage(); page.setContent("<div><button>Click me</button></div>"); // Use the selector prefixed with its name. ElementHandle button = page.querySelector("tag=button"); // Combine it with other selector engines. page.click("tag=div >> text="Click me""); // Can use it in any methods supporting selectors. int buttonCount = (int) page.evalOnSelectorAll("tag=button", "buttons => buttons.length"); browser.close();

Rarely, session storage is used for storing information associated with the logged-in state. Session storage is specific to a particular domain and is not persisted across page loads. Playwright does not provide API to persist session storage, but the following snippet can be used to save/load session storage. // Get session storage and store as env variable String sessionStorage = (String) page.evaluate("() => JSON.stringify(sessionStorage"); System.getenv().put("SESSION_STORAGE", sessionStorage); // Set session storage in a new context String sessionStorage = System.getenv("SESSION_STORAGE"); context.addInitScript("(storage => {
" + " if (window.location.hostname === 'example.com') {
" + " const entries = JSON.parse(storage);
" + " Object.keys(entries).forEach(key => {
" + " window.sessionStorage.setItem(key, entries[key]);
" + " });
" + " }
" + "})(" + sessionStorage + ")");

Playwright scripts run in your Playwright environment. Your page scripts run in the browser page environment. Those environments don't intersect, they are running in different virtual machines in different processes and even potentially on different computers. The Page.evaluate(expression[, arg]) API can run a JavaScript function in the context of the web page and bring results back to the Playwright environment. Browser globals like window and document can be used in evaluate. String href = (String) page.evaluate("document.location.href"); If the result is a Promise or if the function is asynchronous evaluate will automatically wait until it's resolved: int status = (int) page.evaluate("async () => {
" + " const response = await fetch(location.href);
" + " return response.status;
" + "}");

Playwright evaluation methods like Page.evaluate(expression[, arg]) take a single optional argument. This argument can be a mix of Serializable values and JSHandle or ElementHandle instances. Handles are automatically converted to the value they represent. // A primitive value. page.evaluate("num => num", 42); // An array. page.evaluate("array => array.length", Arrays.asList(1, 2, 3)); // An object. Map<String, Object> obj = new HashMap<>(); obj.put("foo", "bar"); page.evaluate("object => object.foo", obj); // A single handle. ElementHandle button = page.querySelector("button"); page.evaluate("button => button.textContent", button); // Alternative notation using elementHandle.evaluate. button.evaluate("(button, from) => button.textContent.substring(from)", 5); // Object with multiple handles. ElementHandle button1 = page.querySelector(".button1"); ElementHandle button2 = page.querySelector(".button2"); Map<String, ElementHandle> arg = new HashMap<>(); arg.put("button1", button1); arg.put("button2", button2); page.evaluate("o => o.button1.textContent + o.button2.textContent", arg); // Object destructuring works. Note that property names must match // between the destructured object and the argument. // Also note the required parenthesis. Map<String, ElementHandle> arg = new HashMap<>(); arg.put("button1", button1); arg.put("button2", button2); page.evaluate("({ button1, button2 }) => button1.textContent + button2.textContent", arg); // Array works as well. Arbitrary names can be used for destructuring. // Note the required parenthesis. page.evaluate( "([b1, b2]) => b1.textContent + b2.textContent", Arrays.asList(button1, button2)); // Any non-cyclic mix of serializables and handles works. Map<String, Object> arg = new HashMap<>(); arg.put("button1", button1); arg.put("list", Arrays.asList(button2)); arg.put("foo", 0); page.evaluate( "x => x.button1.textContent + x.list[0].textContent + String(x.foo)", arg); Right: Map<String, Object> data = new HashMap<>(); data.put("text", "some data"); data.put("value", 1); // Pass |data| as a parameter. Object result = page.evaluate("data => {
" + " window.myApp.use(data);
" + "}", data); Wrong: Map<String, Object> data = new HashMap<>(); data.put("text", "some data"); data.put("value", 1); Object result = page.evaluate("() => {
" + " // There is no |data| in the web page.
" + " window.myApp.use(data);
" + "}");

Playwright supports custom selector engines, registered with Selectors.register(name, script[, options]). Selector engine should have the following properties: create function to create a relative selector from root (root is either a Document, ShadowRoot or Element) to a target element. query function to query first element matching selector relative to the root. queryAll function to query all elements matching selector relative to the root. By default the engine is run directly in the frame's JavaScript context and, for example, can call an application-defined function. To isolate the engine from any JavaScript in the frame, but leave access to the DOM, register the engine with {contentScript: true} option. Content script engine is safer because it is protected from any tampering with the global objects, for example altering Node.prototype methods. All built-in selector engines run as content scripts. Note that running as a content script is not guaranteed when the engine is used together with other custom engines. An example of registering selector engine that queries elements based on a tag name: // Must be a script that evaluates to a selector engine instance. String createTagNameEngine = "{
" + " // Returns the first element matching given selector in the root's subtree.
" + " query(root, selector) {
" + " return root.querySelector(selector);
" + " },
" + "
" + " // Returns all elements matching given selector in the root's subtree.
" + " queryAll(root, selector) {
" + " return Array.from(root.querySelectorAll(selector));
" + " }
" + "}"; // Register the engine. Selectors will be prefixed with "tag=". playwright.selectors().register("tag", createTagNameEngine); // Now we can use "tag=" selectors. ElementHandle button = page.querySelector("tag=button"); // We can combine it with other selector engines using ">>" combinator. page.click("tag=div >> span >> "Click me""); // We can use it in any methods supporting selectors. int buttonCount = (int) page.evalOnSelectorAll("tag=button", "buttons => buttons.length");

Handles can be passed into the Page.evaluate(expression[, arg]) and similar methods. The following snippet creates a new array in the page, initializes it with data and returns a handle to this array into Playwright. It then uses the handle in subsequent evaluations: // Create new array in page. JSHandle myArrayHandle = page.evaluateHandle("() => {
" + " window.myArray = [1];
" + " return myArray;
" + "}"); // Get the length of the array. int length = (int) page.evaluate("a => a.length", myArrayHandle); // Add one more element to the array using the handle Map<String, Object> arg = new HashMap<>(); arg.put("myArray", myArrayHandle); arg.put("newElement", 2); page.evaluate("arg => arg.myArray.add(arg.newElement)", arg); // Release the object when it"s no longer needed. myArrayHandle.dispose();
